import React from "react";
import componentStyle from "./index.module.css";

class Title extends React.Component {
  render() {
    return (
      <div className={componentStyle["heading-primary"]}>
        <h2>
          <span>线</span>
          <span>缆</span>
          <span>系</span>
          <span>统</span>
          <span>电</span>
          <span>磁</span>
          <span>兼</span>
          <span>容</span>
          <span>性</span>
          <span>能</span>
          <span>评</span>
          <span>估</span>
          <span>软</span>
          <span>件</span>
        </h2>
        <button type="button">
          <img
            src={require("../../../public/image/right_arrow.svg")}
            alt="Go ahead"
          />
        </button>
      </div>
    );
  }
}

export default Title;
